import { Typography, Box, styled } from "@mui/material";
const Image = styled(Box)`
  background: url(\public\project_picture\blog_heading_back.png);
`;

const Banner = () =>
{
  return (
    <Image>
      <h1>Hello from banner</h1>
      <img src="/public/project_picture/blog_heading_back.png" alt="picture" />
    </Image>
  );
}

export default Banner;
